from firepot.models import User
from firepot import messages
from tests import TestCase

import json
import random
from firepot.utils import encode_auth_token, decode_auth_token, validate_auth_token


class TestApplicationRoutes(TestCase):
    def tearDown(self):
        super().tearDown()

    def register_and_login(self, first_name, last_name, email, password):
        user_id = self.register(first_name=first_name, last_name=last_name, email=email, password=password)

        token, id = self.login(email=email, password=password)

        self.assertEqual(user_id, decode_auth_token(token)['sub'])
        self.assertEqual(user_id, id)

        req = self.app.test_client().get('/auth/', headers={'Authorization': 'Bearer {0}'.format(token)})
        _json = json.loads(req.data)

        self.assertEqual(_json['status'], 'success')
        return token

    def admin_register_and_login(self, first_name, last_name, email, password):
        user_id = self.register(first_name=first_name, last_name=last_name, email=email, password=password)
        user = User.get_by_id(user_id)

        self.assertIsNotNone(user)

        user.add_permission("firepot.administration")

        self.assertTrue(user.has_permission("firepot.administration"))

        token, user_id = self.login(email=email, password=password)

        req = self.app.test_client().get("/admin/", headers={'Authorization': 'Bearer {0}'.format(token)})

        _json = json.loads(req.data)

        self.assertEqual(_json['status'], 'success')

        return token

    def register(self, first_name, last_name, email, password):
        data = dict(
            first_name=first_name,
            last_name=last_name,
            email=email,
            password=password
        )

        request = self.app.test_client().post('/auth/register/', data=json.dumps(data), follow_redirects=True,
                                              content_type='application/json')

        _json = json.loads(request.data)

        self.assertEqual(_json['status'], 'success', msg=_json['message'])

        return _json['payload']['id']

    def login(self, email, password):
        """
        Login to an account and retrieve the auth token
        :param email:
        :param password:
        :return:
        """

        login_data = dict(
            email=email,
            password=password
        )

        request = self.app.test_client().post('/auth/login/', data=json.dumps(login_data), follow_redirects=True,
                                              content_type='application/json')
        _json = json.loads(request.data)

        self.assertEqual(_json['status'], 'success', msg=_json['message'])

        token = _json['payload']['auth']
        id = _json['payload']['id']
        return token, id

    def test_login_and_register(self):
        from firepot.models import User
        auth_token = self.register_and_login(first_name="B", last_name="C", email="test@firepot.ca", password="testing")

        self.assertIsNotNone(auth_token)

        decoded = decode_auth_token(auth_token)

        self.assertIsNot(decoded, False)

        self.assertEqual(decoded['sub'], User.query.filter_by(email="test@firepot.ca").first().id)

    def test_products_list(self):
        from firepot.models import Item, Product, Image, Tag
        token = self.register_and_login(first_name="B", last_name="C", email="test@firepot.ca", password="testing")
        req = self.app.test_client().get("/store/products", headers={'Authorization': 'Bearer {0}'.format(token)})

        _json = json.loads(req.data)

        self.assertEqual(_json['message'], "Currently no stock available")

        silver_haze_img = Image(name="silver_haze_1", data="Base64 of super silver haze bb")
        silver_haze_img.save(commit=True)

        self.assertIsNotNone(Image.query.filter_by(name="silver_haze_1").first())

        sativa_tag = Tag(name="Sativa")
        sativa_tag.save(commit=True)

        self.assertIsNotNone(Tag.query.filter_by(name="Sativa").first())

        silver_haze = Item(name="Super Silver Haze", description="Epic Sativa AAAA Exotic level",
                           cover_image_id=silver_haze_img.id, images=[silver_haze_img], tags=[sativa_tag],stock=28)

        silver_haze.save(commit=True)

        self.assertIsNotNone(Item.query.filter_by(name="Super Silver Haze").first())

        product = Product(name="Super Silver Haze (1g)", item_id=silver_haze.id, cost=10, stock_weight=1)
        product.save(commit=True)

        self.assertGreaterEqual(len(Product.query.filter_by(item_id=silver_haze.id).all()), 1)

        req = self.app.test_client().get("/store/products", headers={'Authorization': 'Bearer {0}'.format(token)})

        _json = json.loads(req.data)

        self.assertEqual(_json['message'], "Store Products List")

        _items = _json['payload']['items']

        self.assertGreaterEqual(len(_items.keys()), 1)

    def test_user_is_admin(self):
        token = self.admin_register_and_login(first_name="b", last_name="c", email="test@firepot.ca",
                                              password="testing")
        self.assertIsNotNone(token)

        req = self.app.test_client().get("/admin/", headers={'Authorization': 'Bearer {0}'.format(token)})
        _json = json.loads(req.data)

    def test_user_is_not_admin(self):
        auth_token = self.register(first_name="b", last_name="c", email="test@firepot.ca", password="testing")
        req = self.app.test_client().get("/admin/", headers={'Authorization': 'Bearer {0}'.format(auth_token)})
        _json = json.loads(req.data)
        self.assertEqual(_json['status'], 'error')

    def test_inventory_new_item_and_new_product(self):
        from firepot.models import Item
        token = self.admin_register_and_login(first_name="B", last_name="C", email="test@firepot.ca",
                                              password="testing")

        req = self.app.test_client().post("/admin/inventory/new/",
                                          headers={'Authorization': 'Bearer {0}'.format(token)},
                                          content_type="application/json", follow_redirects=True, data=json.dumps(dict(
                name="Super Silver Haze",
                description="Beautiful Sativa with that evening vibe",
                cover_image_name="super_silver_haze_1",
                cover_image_data="data:image/jpeg;base64,",
                tags="Sativa"
            )))

        _json = json.loads(req.data)

        self.assertEqual(_json['status'], 'success')

        item = _json['payload']['item']

        _item = Item.query.filter_by(name="Super Silver Haze").first()
        self.assertIsNotNone(_item)

        self.assertIsNotNone(item)
        self.assertEqual(item['id'], _item.id)

        # Test that it fails correctly

        req = self.app.test_client().post("/admin/inventory/new/",
                                          headers={'Authorization': 'Bearer {0}'.format(token)},
                                          content_type="application/json", follow_redirects=True, data=json.dumps(dict(
                name="Super Silver Haze",
                description="Beautiful Sativa with that evening vibe",
                cover_image_name="super_silver_haze_1",
                cover_image_data="data:image/jpeg;base64,",
                tags="Sativa"
            )))

        _json = json.loads(req.data)

        self.assertEqual(_json['status'], 'error')
        self.assertEqual(_json['message'], messages.DUPLICATE_ITEM_NAME)

        req = self.app.test_client().post('/admin/inventory/product/new/', headers={'Authorization': 'Bearer {0}'.format(token)},
                                          data=json.dumps(dict(
                                              item_id=_item.id,
                                              name="1g",
                                              cost=10,
                                              sale_cost=10,
                                              stock_weight=1
                                          )), content_type='application/json')

        _json = json.loads(req.data)
        self.assertEqual(_json['status'], 'success')
        self.assertEqual(_json['message'],messages.PRODUCT_CREATED)
